import React, { useState } from 'react';
import { Link } from 'react-router-dom';

function SalesPred() {
    // State variables to store user inputs
    const [suburb, setSuburb] = useState('');
    const [suggestions, setSuggestions] = useState([]);
    const [numRooms, setNumRooms] = useState('');
    const [houseType, setHouseType] = useState('');
    const [landsize, setLandsize] = useState('');

    const handleSuburbChange = async (e) => {
        const userInput = e.target.value;
        setSuburb(userInput);

        if (userInput) {
            const response = await fetch(`http://localhost:5000/api/suburbs?query=${userInput}`);
            const data = await response.json();
            setSuggestions(data);
        } else {
            setSuggestions([]);
        }
    };

     // Inline styles for suggestions list
        const suggestionsListStyle = {
        listStyleType: 'none',
        margin: 0,
        padding: '0.5rem',
        border: '1px solid #ccc',
        maxWidth: '200px',
        backgroundColor: '#fff',
        position: 'absolute',
        zIndex: 1,
    };

    const suggestionItemStyle = {
        padding: '0.5rem',
        cursor: 'pointer',
        listStyleType: 'none',
    };





    return (
        <div>
            <h1>View the sales price of the house you are looking for</h1>

            {/* Suburb Input */}
            <label>
                Enter suburb:
                <input 
                    type="text" 
                    value={suburb} 
                    onChange={handleSuburbChange} 
                    placeholder="Enter suburb"
                    autoComplete="off"
                />
            </label>
            {suggestions.length > 0 && (
                <ul className="suggestions-list">
                    {suggestions.map((suggestion, index) => (
                        <li 
                            key={index}
                            onClick={() => {
                                setSuburb(suggestion);
                                setSuggestions([]);
                            }}
                        >
                            {suggestion}
                        </li>
                    ))}
                </ul>


            )}

            {/* Number of Rooms Dropdown */}
            <label>
                Enter number of rooms:
                <select 
                    value={numRooms} 
                    onChange={(e) => setNumRooms(e.target.value)}
                >
                    <option value="">Select number of rooms</option>
                    <option value="1">1</option>
                    <option value="2">2</option>
                    <option value="3">3</option>
                    <option value="4">4</option>
                    <option value="5">5</option>
                    <option value="6">6</option>
                    <option value="7">7</option>
                </select>
            </label>

            {/* Type of House Dropdown */}
            <label>
                Enter type of house:
                <select 
                    value={houseType} 
                    onChange={(e) => setHouseType(e.target.value)}
                >
                    <option value="">Select house type</option>
                    <option value="House">House</option>
                    <option value="Townhouse">Townhouse</option>
                    <option value="Unit">Unit</option>
                </select>
            </label>

            {/* Landsize Input */}
            <label>
                Enter landsize:
                <input 
                    type="text" 
                    value={landsize} 
                    onChange={(e) => setLandsize(e.target.value)} 
                    placeholder="Enter landsize (sqm)"
                />
            </label>

            {/* Button to Navigate to Generated Sales Prediction */}
            <Link to="/GeneratedSalesPredictions">
                <button>Generate Sales Prediction</button>
            </Link>
        </div>
    );
}

export default SalesPred;
